import React from 'react';

const UploadFile = (props) => {
    const { handleOnChange, saveInput, handleSubmit } = props;
    return (
        <React.Fragment>
            <p className='display-6 text-center mb-3'>Upload Stock Image</p>
            <div className='mb-5 d-flex align-items-center justify-content-center'>
                <form onSubmit={handleSubmit} className="mb-2" style={{ textAlign: "left" }}>
                    <div className="mb-3">
                        <input onChange={() => handleOnChange(saveInput, 5000)} type="text" className="form-control" name="title" placeholder='title' aria-describedby='text' id="formFile" />
                    </div>
                    <div className="mb-3">
                        <input className="form-control" type="file" id="formFile" />
                    </div>
                    <div className="col-auto">
                        <button type="submit" className="btn btn-success float-end">Save changes</button>
                    </div>
                </form>
            </div>
        </React.Fragment>
    )
}

export default UploadFile;
